import{_ as e,c as s,o as i,ag as o}from"./chunks/framework.CxQVUucW.js";const t="/docs/assets/image-4.H64CpCsB.png",r="/docs/assets/image-5.BqItNa-h.png",d="/docs/assets/image-6.CShmcCav.png",l="/docs/assets/image-7.9MCVwY8O.png",p="/docs/assets/image-14.CnSS1gm3.png",n="/docs/assets/image-15.CZWKF62P.png",c="/docs/assets/image-16.CKZTr0Yj.png",m="/docs/assets/image-17.SM4w33Ax.png",u="/docs/assets/image-19.Tfd1iuie.png",h="/docs/assets/image-20.CTVmI2jb.png",w=JSON.parse('{"title":"Relatórios em PDF","description":"","frontmatter":{"prev":{"text":"Reservar pelo Mapa de Salas","link":"./reservations"},"next":{"text":"Solicitar uma Sala","link":"/solicitate-a-classroom"}},"headers":[],"relativePath":"allocation/pdfs.md","filePath":"allocation/pdfs.md"}'),x={name:"allocation/pdfs.md"};function g(f,a,b,v,_,y){return i(),s("div",null,[...a[0]||(a[0]=[o('<h1 id="relatorios-em-pdf" tabindex="-1">Relatórios em PDF <a class="header-anchor" href="#relatorios-em-pdf" aria-label="Permalink to &quot;Relatórios em PDF&quot;">​</a></h1><p>É possível baixar PDF&#39;s com alguns tipos de relatórios, cada relatório tem uma informação distinta e um formato diferente, para ver as opções disponíveis basta clicar no botão &quot;+Baixar&quot;, conforme a imagem abaixo.</p><div style="display:flex;justify-content:center;align-items:center;width:100%;"><img src="'+t+'" alt="Descrição" style="border-radius:8px;max-width:100%;height:auto;box-shadow:0 4px 16px rgba(0,0,0,0.1);"></div><p>Um menu irá abrir com todas as opções disponíveis, vamos entrar em detalhes sobre cada um em seguida.</p><div style="display:flex;justify-content:center;align-items:center;width:100%;"><img src="'+r+'" alt="Descrição" style="border-radius:8px;max-width:100%;height:auto;box-shadow:0 4px 16px rgba(0,0,0,0.1);"></div><p>Para todos os tipos de relatórios você pode especificar um início e fim, isso se refere ao intervalo que ele irá considerar para gerar esses relatórios, por exemplo:</p><p>para um início de 21/07/2025 até 31/12/2025, serão consideras todas as disciplinas e turmas que estão <strong>DENTRO</strong> desse intervalo.</p><h2 id="alocacao-das-disciplinas-pdf" tabindex="-1">Alocação das disciplinas (PDF) <a class="header-anchor" href="#alocacao-das-disciplinas-pdf" aria-label="Permalink to &quot;Alocação das disciplinas (PDF)&quot;">​</a></h2><p>Esse relatório mostra todas as alocações de determinado prédio no formato de tabela, ao clicar no botão o seguinte formulário irá aparecer:</p><div style="display:flex;justify-content:center;align-items:center;width:100%;"><img src="'+d+'" alt="Descrição" style="border-radius:8px;max-width:100%;height:300px;box-shadow:0 4px 16px rgba(0,0,0,0.1);"></div><p>Basta escolher o prédio que o botão para baixar o pdf irá ser desbloqueado, ao clicar no botão o relatório será baixado. Um exemplo do formato desse relatório pode ser visto a seguir:</p><div style="display:flex;justify-content:center;align-items:center;width:100%;"><img src="'+l+'" alt="Descrição" style="border-radius:8px;max-width:100%;height:auto;box-shadow:0 4px 16px rgba(0,0,0,0.1);"></div><h2 id="mapa-de-salas-pdf" tabindex="-1">Mapa de Salas (PDF) <a class="header-anchor" href="#mapa-de-salas-pdf" aria-label="Permalink to &quot;Mapa de Salas (PDF)&quot;">​</a></h2><p>Esse opção gera um relatório das alocações no formato de calendário, cada página do PDF é uma sala de aula com o calendário da semana com os horários ocupados, exatamente igual a visualização Geral, porém, cada página é de uma sala.</p><p>O formulário é igual ao da alocação das disciplinas, você escolhe um prédio. A diferença é que ele não baixa um PDF imediatamente, ele vai te mostrar uma tela onde você salva em formato PDF, conforme as imagens abaixo.</p><div style="display:flex;justify-content:center;align-items:center;width:100%;"><img src="'+p+'" alt="Descrição" style="border-radius:8px;max-width:100%;height:300px;box-shadow:0 4px 16px rgba(0,0,0,0.1);"></div><p>Aqui basta clicar em salvar que irá baixar o PDF com a aparência correta, mesmo não parecendo inicialmente.</p><div style="display:flex;justify-content:center;align-items:center;width:100%;"><img src="'+n+'" alt="Descrição" style="border-radius:8px;max-width:100%;height:auto;box-shadow:0 4px 16px rgba(0,0,0,0.1);"></div><p>Aqui um exemplo de cada página do relatório.</p><div style="display:flex;justify-content:center;align-items:center;width:100%;"><img src="'+c+'" alt="Descrição" style="border-radius:8px;max-width:100%;height:auto;box-shadow:0 4px 16px rgba(0,0,0,0.1);"></div><h2 id="disciplinas-escolhidas-pdf" tabindex="-1">Disciplinas escolhidas (PDF) <a class="header-anchor" href="#disciplinas-escolhidas-pdf" aria-label="Permalink to &quot;Disciplinas escolhidas (PDF)&quot;">​</a></h2><p>Esse relatório é igual ao <a href="#alocação-das-disciplinas-pdf">Alocação das Disciplinas</a> com a diferença de que você que escolhe quais disciplinas serão consideras, sem estar limitado a um mesmo prédio. A seguir, está a imagem do menu com algumas disciplinas já selecionadas.</p><div style="display:flex;justify-content:center;align-items:center;width:100%;"><img src="'+m+'" alt="Descrição" style="border-radius:8px;max-width:100%;height:300px;box-shadow:0 4px 16px rgba(0,0,0,0.1);"></div><p>Basta então clicar em confirmar que o botão de baixar será liberado.</p><h2 id="disponibilidade-de-salas-pdf" tabindex="-1">Disponibilidade de salas (PDF) <a class="header-anchor" href="#disponibilidade-de-salas-pdf" aria-label="Permalink to &quot;Disponibilidade de salas (PDF)&quot;">​</a></h2><p>Esse relatório funciona igual ao relatório <a href="#mapa-de-salas-pdf">Mapa de Salas</a>, com a diferença de que ao invés de mostrar as alocações, mostra o inverso, ou seja, os horários disponíveis.</p><div style="display:flex;justify-content:center;align-items:center;width:100%;"><img src="'+u+'" alt="Descrição" style="border-radius:8px;max-width:100%;height:300px;box-shadow:0 4px 16px rgba(0,0,0,0.1);"></div><p>Após salvar você obtem o seguinte formato de relatório:</p><div style="display:flex;justify-content:center;align-items:center;width:100%;"><img src="'+h+'" alt="Descrição" style="border-radius:8px;max-width:100%;height:auto;box-shadow:0 4px 16px rgba(0,0,0,0.1);"></div><p>Note que ele é o oposto do que foi visto no relatório de Mapa de Salas.</p>',30)])])}const q=e(x,[["render",g]]);export{w as __pageData,q as default};
